import React, { useState } from 'react';
import { Link } from 'react-router-dom';
function Navbar() {
  const [selectedMenu, setselectedMenu] = useState(0);

  const handleMenuClick = (index) => {
    setselectedMenu(index);
  };
  const menuClass = "menu";
  const activeMenuClass = "menu selected";
  return (
    <>
      <nav className="navbar navbar-expand-lg background">
        <div className="container" >
          <Link className="navbar-brand"
            to={"/"}
            style={{ color: "#fff", fontWeight: "700", fontSize: "25px" }}
            onClick={() => handleMenuClick(0)}
            className={selectedMenu === 0 ? activeMenuClass : menuClass}>
            HealthTracker</Link>
          <div className="collapse navbar-collapse">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <Link className="nav-link" to={"/"}
                  onClick={() => handleMenuClick(1)}
                  className={selectedMenu === 1 ? activeMenuClass : menuClass}>Home</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to={"/blog"} onClick={() => handleMenuClick(2)}
                  className={selectedMenu === 2 ? activeMenuClass : menuClass}>Blog</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link " to={"/pricing"}
                  onClick={() => handleMenuClick(3)}
                  className={selectedMenu === 3 ? activeMenuClass : menuClass}>Pricing</Link>
              </li>
              <li className="nav-item ">
                <Link className="nav-link " to={"/pomodoro"} onClick={() => handleMenuClick(4)}
                  className={selectedMenu === 4 ? activeMenuClass : menuClass}><i className="fa-solid fa-stopwatch"></i> Pomodoro</Link>
              </li>
            </ul>
            <form className="d-flex" role="search">
              <a style={{ marginTop: "1rem",fontSize:"20px" }}><i className="fa-solid fa-sun nav-links"></i></a>

              <Link to={"/register"}><button className="btn nav-links btn-success fs-5" style={{padding:"6px 15px",color: "#fff", margin: "13px 0px 0px 25px"}}>Register</button></Link>
              <Link to={"/login"}><button className="btn btn-outline-light nav-links fs-5" style={{ margin: "12px 20px 0px 15px",padding:"6px 12px" }}>LogIn</button></Link>
              <Link to={"/profile"} style={{ margin: "0.6rem ",fontSize:"30px" }}><i className="fa-solid fa-circle-user nav-links"></i></Link>
            </form>
          </div>
        </div>
      </nav>
    </>
  );
}

export default Navbar;
